import React from 'react'
import Data from './Data';

const Welcome = (props) =>{
    function dyn(val){
        name= val.name
        age = val.age
    }
    return(
        <>
           <div className="card">
               <h1>name : {val.name}</h1>
               <h1>Age : {val.age}</h1>
           </div>
           {Data.map(dyn)}
        </>
    )
}
export default Welcome;
